def fib(n):
    if n == 0:
        return 0
    elif n == 1:
        return 1
    else:
        a, b = 0, 1
        for _ in range(2, n + 1):
            a, b = b, a + b
        return b
```

This function calculates the nth Fibonacci number using an iterative approach. It initializes two variables `a` and `b` to represent the first two Fibonacci numbers (0 and 1, respectively). Then, it iterates from 2 to n, updating `a` and `b` at each step to hold the last two Fibonacci numbers until it reaches the nth number, which is then returned. This approach avoids the exponential time complexity of a naive recursive solution.
